import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import "./index.css";
import ReactModal from 'react-modal';

ReactModal.setAppElement('#root');

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
